# Definition for singly-linked list.
class ListNode:
    def __init__(self, x):
        self.val = x
        self.next = None

class Solution:
    # @param head, a ListNode
    # @return a ListNode
    def sortList(self, head):
    	return self.mergesort(head)

    def mergesort(self, head):
    	if head ==None:
    		return None
    	if head.next==None:
    		return head
    	walker = head
    	runner = head
    	while runner.next!=None and runner.next.next!=None:
    		walker=walker.next
    		runner=runner.next.next
    	head2 = walker.next
    	walker.next = None
    	head1 = head
    	head1 = self.mergesort(head1)
    	head2 = self.mergesort(head2)
    	return self.merge(head1, head2)

    def merge(self, head1, head2):
    	head = ListNode(0)
    	cursor = head
    	while head1!=None and head2!=None:
    		if head1.val < head2.val:
    			cursor.next = head1
    			head1 = head1.next
    		else:
    			cursor.next = head2
    			head2 = head2.next
    		cursor = cursor.next
    	remained = head1 if head1!=None else head2
    	if remained!=None:
    		cursor.next = remained
    	return head.next

